import React from 'react'

const Work = () => {
  return (
    <div name='work' className='w-full md:h-screen text-gray-300 bg-[#0a192f]'>
    {/* Container */}
    <div>
        <div>
            <p>Work</p>
            <p><code>Check out some recent projects</code></p>
        </div>
    </div>
    </div>
  )
}

export default Work
